def findLogBeta(alpha, beta, base, n, smallLog):
    while(True):
        l = random.randint(0, n-1)
        tmp = (beta * powMod(alpha, l, n)) % n
        p_i = factorint(tmp)
        smooth = 1
        num = 0
        for p, power in p_i.items():
            exist, indexP = binarySearch(p, base)
            if exist == 1:
                num = (num + smallLog[indexP]*power) % (n - 1)
            else:
                smooth = 0
                break
        if smooth == 1:
            return (num - l) % (n - 1)

